import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function StandingLine(props) {
    return (
        <Link to={"/team/" + (props.teamId)}>
            <div className="p-4 rounded-lg flex justify-between hover:bg-[#f8f8f8]">
                <div className="flex gap-3 items-center basis-6/12">
                    <div className="font-medium text-sm text-end" style={{minWidth:"1em"}}>{props.number}</div>
                    <div style={{width: ".5rem", height: ".5rem",border: "0.125em solid #a19db3", borderRadius: "50%",}}></div>
                    {/* <div className="h-10 w-10 rounded-full flex items-center justify-center" style={{border: "0.05em solid #a19db3"}}>
                        <img className="h-7 object-fit" src={props.teamLogo} alt="teamLogo" />
                    </div> */}
                    <div className="text-sm font-medium">{props.teamName}</div>
                </div>
                <div className="flex items-center basis-5/12 text-end">
                    <div className="text-sm text-[#6d6a7f] basis-2/12">{props.teamPlayed}</div>
                    <div className="text-sm text-[#6d6a7f] basis-2/12">{props.teamWins}</div>
                    <div className="text-sm text-[#6d6a7f] basis-2/12">{props.teamDraws}</div>
                    <div className="text-sm text-[#6d6a7f] basis-2/12">{props.teamLose}</div>
                    <div className="text-sm text-[#6d6a7f] basis-2/12">{props.teamLose}</div>
                    <div className="text-sm font-medium basis-2/12">{props.teamPoints}</div>
                </div>
            </div>
        </Link>
    );
}

export default StandingLine;
